define(["require","exports","module"],function(e,t,n){t.create=function(e){e.svg.selectAll("circle").data(e.data).enter().append("circle").attr("class",e.dotCls).attr("cx",function(t){return e.xScale(t[0])}).attr("cy",function(t){return e.yScale(t[1])}).attr("r",e.dotRadius),e.svg.selectAll("text").data(e.data).enter().append("text").text(function(e){return e.join(", ")}).attr("font-family","sans-serif").attr("font-size","11px").attr("fill",e.labelColor).attr("x",function(t,n){return e.xScale(t[0])+e.dotRadius}).attr("y",function(t){return e.yScale(t[1])})}});